function Main(props) {
    const { currentUser } = props
    console.log(currentUser)
    if (currentUser.isAuthenticated) {
        return (
            <div>
                Logged in
            </div>
        )
    }
    return (
        <div>
            <h1>
                Not Logged In Mate
            </h1>
        </div>
    )
}

export default Main
